import React from 'react';
import "./SearchBar.scss"

function SearchBar() {
  return (
    <form>
      <input
        type="text"
        placeholder="Search..."
      />
       <button class="search-icon">
        <img src="../../assets/images/icons\search.svg" alt="Search"></img>
    </button>
    </form>
  );
}

export default SearchBar;
